import { Modal } from "@mui/material";
import React from "react";

const StateModalOpen = ({ open }) => {
  return (
    <Modal
      open={open}
      style={{
        height: "100%",
        width: "100%",
        display: "flex",
        alignItems: "center",
        justifyContent: "center",
      }}
    ></Modal>
  );
};

export default StateModalOpen;
